	//prototype BEGIN
	$.prototype.ddl = function(argument){
		if (!this[0]) { return false }
			$(this).each(function(index, el) {
				var ddl = 	$(this).hasClass('ddl')?$(this):$(this).find('.ddl'),
				btn = 		ddl.find('.select'),
				item = 		ddl.find('.item'),
				list = 		ddl.find('.list'),
				select = 	ddl.find('.select');
				btn.click(function(event) {
					ddltoogle();
					$(this).toggleClass('active');
				});
				item.click(function(event) {
					ddl.removeClass('active');
					select.html($(this).html());
					list.children('.active').removeClass('active');
					$(this).addClass('active');
				});
				function ddltoogle(){
					ddl.toggleClass('active');
				}
			});
	};
	$.prototype.genvid = function(argument){
		if(!$(this)[0]){return false}
			var t = $(this),p=$(t).parent(),id= $(t)[0].dataset.vidid;
		p.addClass('loaded');
	
		var nframe = document.createElement('iframe');
		nframe.src = 'https://www.youtube.com/embed/'+id;
		nframe.id= id;
		$(t).append(nframe);
	};
	$.prototype.mbar = function(arg){
		if(!$(this)[0]){ return false }
			var
		label = $(this).find('.label'),
		strip = $(this).find('.strip'),
		s = parseInt(this[0].dataset.prc),
	
		tc = 0,tt=0;
		t = 1000*(s/100)
		var Interval =  setInterval(function(){
			tt=tt+1;
			label.text(tt+'%');
			strip.width(tt+'%');
			if(tt==s){
				clearInterval(Interval)
			}
		}, 10);
	};
	$.prototype.stars = function(click){
		var 
		list = $(this),
		item = $(this).children();
		if(click){
			setevents();
		}
		if(parseInt(list[0].dataset.st) != 0){
			for (var i = 0 ; i-1 !== parseInt(list[0].dataset.st)-1; i++) {
				$(item[i]).addClass('active');
			}
		}
		function setevents(){
			list.addClass('clicked');
			item.mouseenter(function(){
				faddclass('hover',this);
			});
			list.mouseleave(function(event) {
				list.find('.hover').removeClass('hover');
			});
			item.click(function(){
				faddclass('active',this);
				list.attr('data-st',$(this).index()+1)
			});
		}
		faddclass = function(arg,t){
			list.find('.'+arg).removeClass(arg);
			for (var i = 0 ; i-1 !== $(t).index(); i++) {
				$(item[i]).addClass(arg);
			}
		}
	};
	$.prototype.drwlines = function(argument){
		trg = $(this[0].dataset.trg);
		trg.html("");
		var
		d = document.createElement('div'),
		t= $(this), 
		offsetC = trg.offset(),
		offsetT =t.offset(),
		h=offsetC.top-(offsetT.top),
		w=offsetC.left-(offsetT.left),
		wi = Math.sqrt((w*w)+(h*h)),
		angle = get_angle({x:offsetC.left,y:offsetC.top},{x:offsetT.left,y:offsetT.top});
		d.className='sdline';
		$(d).css({
			"width": wi +'px',
			transform: "rotate("+angle+"deg)"
		});
		trg.append(d);
		function get_angle(target, point){
			var x = point.x - target.x;
			var y = point.y - target.y;
			var a = Math.atan(y/x)*180/Math.PI;
			return a+(x<0?180:0);
		}
	};
	$.prototype.parallax = function(boost){
		var currentX = '';
		var currentY = '';
		var movementConstant = boost || .015;
		$(this).mousemove(function(e) {
			if(currentX == '') currentX = e.pageX;
			var xdiff = e.pageX - currentX;
			currentX = e.pageX;
			if(currentY == '') currentY = e.pageY;
			var ydiff = e.pageY - currentY;
			currentY = e.pageY; 
	
			$(this).find('.js-parallax .layer').each(function(i, el) {
				var movement = (i + 1) * (xdiff * movementConstant);
				var movementy = (i + 1) * (ydiff * movementConstant);
				var newX = $(el).position().left + movement;
				var newY = $(el).position().top + movementy;
				$(el).css('left', newX + 'px');
				$(el).css('top', newY + 'px');
			});
		});
		$(this).mouseleave(function(e){
			$(this).find('.js-parallax .layer').each(function(i, el) {
				$(el).css({'left':'','top':'','transition': 'left 0.3s, top 0.3s'})
				setTimeout(function() {
					$(el).css({'transition': ''})
				}, 300);
			});
		})
	
	
		$(this).mouseenter(function(e){
			$(this).find('.js-parallax .layer').each(function(i, el) {
				$(el).stop(false,true);
			});
		})
	};
