var mload = function(){
	if( /Android|webOS|iPhone|iPad|iPod|BlackBerry/i.test(navigator.userAgent) ) {
		$('body').addClass('ios');
	};
	$('[data-cadd]').each(function(index, el) {
		
		var t = $(this)
		$(t).addClass(t[0].dataset.cadd+'-p')
		
	});
	$('body').removeClass('loaded'); 
	
	mresize()
	mscroll();
}
var mresize = function(){
	$('.smart_el .point').each(function(index, el) {
		$(this).drwlines()
	});
	handler();
}
var mscroll = function(){
	var sh=window.pageYOffset +$(window).height();
	$('[data-cadd]').each(function(index, el) {
		if(sh+($(window).height()*0.3)>=$(this).offset().top){
			var t = $(this)
			setTimeout(
				function(){
					$(t).addClass(t[0].dataset.cadd)
					$(t).addClass('animated');
				}, 300)
		} 
	}); 
	if(document.documentElement.scrollTop || document.body.scrollTop > $(window).height()){
		$('.dumbbtn').addClass('active');
	}
	else{
		$('.dumbbtn').removeClass('active');
	}

	if($('.bar_el')[0])
	{
		if(sh >=$('.bar_el').offset().top){
			$('.bar_el').each(function(index, el) {
				if(sh>=$(this).offset().top && !$(this).hasClass('played') ){
					$(this).addClass('played');
					$(this).mbar();
				}
			});
		}
	}
}
$(document).on('mousewheel DOMMouseScroll', function(event) {
	$('body,html').stop(true, false);
});

$(window).bind('load', mload);
$(window).bind('resize', mresize);
$(window).bind('scroll', mscroll);






